

<div class="history metadata">
<div class="dropdown admonition">
    <p class="admonition-title">Show full history</p>
    <div class="history metadata">
        <table>
            <tr>
                <th class="name">Output</th>
                <th class="processor">Processor</th>
                <th class="type">Type</th>
                <th class="version">Version</th>
            </tr>
            {% for item in obj %}
            <tr>
                <td>{{ item["output"] }}</td>
                <td>{{ item["processor"] }}</td>
                <td>{{ item["type"] }}</td>
                <td>{{ item["version"] }}</td>
            </tr>
            {% endfor %}
        </table>
    </div>
</div>
</div>
